(null,"14853","","290","sitemap","Domov","domov","0","0","homepage","","","2019-02-22 21:30:11","2019-02-22 21:53:57","2019-02-22 21:30:00","0","","<p>&nbsp;</p>\n\n<p><span style=\"font-size:14px\">Sme mlad&aacute; firma založen&aacute; a zložen&aacute; z b&yacute;val&yacute;ch, s&uacute;časn&yacute;ch, profesion&aacute;lnych i amat&eacute;rskych bikerov, ktor&uacute; d&uacute;fame bud&uacute; nav&scaron;tevovať a mať radi ďal&scaron;&iacute; bikeri v&scaron;etk&yacute;ch kateg&oacute;ri&iacute;. Na&scaron;im cieľom je vybudovať profituj&uacute;ci bicyklov&yacute; obchod, servis a požičovňu pre v&scaron;etk&yacute;ch, ktor&iacute; hľadaj&uacute; poctiv&yacute; a profesion&aacute;lny pr&iacute;stup, &scaron;irok&uacute; a zauj&iacute;mav&uacute; ponuku a netradičn&eacute; služby. Pon&uacute;kame v&aacute;m svetov&eacute; renomovan&eacute; značky bicyklov v&scaron;etk&eacute;ho druhu, doplnkov a oblečenia, ktor&eacute; považujeme za kvalitn&eacute;, atrakt&iacute;vne a jedinečn&eacute; z&aacute;roveň. V&auml;č&scaron;ina pon&uacute;kan&yacute;ch produktov je nami vybran&aacute; a neust&aacute;le testovan&aacute; nami alebo na&scaron;imi jazdcami.</span></p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" class=\"center-block\" src=\"http://bicykle-hlohovec.localhost/dnt3/dnt-view/data/uploads/formats/600/56_7b0c9089c319d59846caff88c697ae14_o.jpg\" style=\"max-width:350px\" /></p>\n","","","","","10","1","","0","56","0"),
(null,"14854","","290","sitemap","Bicykle","bicykle","0","0","singl_page","","3071","2019-02-22 21:31:08","2019-02-22 22:28:06","2019-02-22 21:31:00","0","<p>V na&scaron;ej ponuke n&aacute;jdete modely t&yacute;ch najlep&scaron;&iacute;ch značiek bicyklov. Od cestn&yacute;ch cez trekingov&eacute; až po horsk&eacute; bicykle. Z&aacute;roveň n&aacute;jdete u n&aacute;s elektro bicyklov. V na&scaron;ich predajniach n&aacute;jdete aj cyklo doplnky, oblečenie a cyklo n&aacute;radie.</p>\n","<p>Značkov&eacute; bicykle od renomovan&yacute;ch v&yacute;robcov<strong> Merida, Cube, Ghost a Lapierre</strong> s&uacute; doplnen&eacute; aj o na&scaron;e lok&aacute;lne, slovensk&eacute; a česk&eacute; značky ako jeDema, Leader Fox a Author. U n&aacute;s si vyberie bicykel každ&yacute; cyklista, m&aacute;me v ponuke horsk&eacute;, krosov&eacute;, trekingov&eacute;, detsk&eacute;, mestsk&eacute;, cestn&eacute;bicykle, ale aj okrajov&eacute; druhy ako cyklokrosov&eacute;, freestyle, dirt, BMX a fitness bicykle. BMX bicykle pon&uacute;kame od &scaron;pičkov&yacute;ch značiek Cult, Wethepeople, Subrosa, Fiend a BeFly.</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" class=\"center-block\" src=\"http://bicykle-hlohovec.localhost/dnt3/dnt-view/data/uploads/formats/350/56_58bd3e3ffd3aff5e7a449e6fb2139400_o.jpg\" style=\"max-width:350px\" /></p>\n","","","","","9","1","","0","56","0"),
